import CompanyPage from "Pages/copmany/CompanyPage";
import PersonPage from "Pages/person/PersonPage";
import React from "react";
import Footer from "Widgets/footer/Footer";
import { MobileConteiner } from "./style";
import { Icon } from "Shared/svg/Icon";
import { useSelector } from "react-redux";
import { selectPage } from "Features/store/pageSlice";

export default function Mobile() {
  const activePage2 = useSelector(selectPage);
  return (
    <MobileConteiner>
      <Icon id="man" className="mobile-logo" />
      <PersonPage />
      <Footer />
      <CompanyPage />
      <Footer activePage2={"true"} />
    </MobileConteiner>
  );
}
